if ( !step.getWait() || (item instanceof Job || item instanceof Queue.Task)) {
    EnvVars env = invokingRun.getEnvironment(listener);
    env.overrideAll(step.getParameters());
    job = env.expand(job);
    listener.getLogger().println("Scheduling project: " + job);
    node.addAction(new LabelAction(Messages.BuildTriggerStepExecution_building_(job)));

if ( !step.getWait() || (item instanceof Queue.Task)) {
    if (item instanceof Job) {
        Job<?,?> project = (Job<?,?>) item;
        listener.getLogger().println("Scheduling project: " + ModelHyperlinkNote.encodeTo(project));
        node.addAction(new LabelAction(Messages.BuildTriggerStepExecution_building_(project.getFullDisplayName())));
        List<Action> actions = new ArrayList<>();
        if (step.getWait()) {
            StepContext context = getContext();
            boolean isPropagate =  step.isPropagate();
            actions.add(new BuildTriggerAction(context, isPropagate ));
            LOGGER.log(Level.FINER, "scheduling a build of {0} from {1}", new Object[]{project, context});
        }
        Cause.UpstreamCause cause = new Cause.UpstreamCause(invokingRun);
        CauseAction causeAction = new CauseAction(cause);
        actions.add(causeAction);
        List<ParameterValue> parameters = step.getParameters();
        if (parameters != null) {
            parameters = completeDefaultParameters(parameters, (Job) project);
            actions.add(new ParametersAction(parameters));
        }
        Integer quietPeriod = step.getQuietPeriod();
        if (quietPeriod == null) {
            quietPeriod = project.getQuietPeriod();
        }
        QueueTaskFuture<?> f = project.scheduleBuild2(quietPeriod, actions.toArray(new Action[actions.size()]));
        if (f == null) {
            throw new Abort

if ( !step.getWait() || (item instanceof Job) || (item instanceof Queue.Task)) {
    Run.ArtifactList artifactList = invokingRun.getArtifactsUpTo(node);
    if (artifactList != null) {
        for (Run.Artifact artifact : artifactList) {
            String artifactFileName = artifact.getFileName();
            FilePath artifactFile = new FilePath(artifact.getFile());
            if (artifactFile.exists()) {
                FilePath targetFile = new FilePath(node.getWorkspaceFor(item), artifactFileName);
                targetFile.copyFrom(artifactFile);
            }
        }
    }

